import React from "react";
// import icons
import { BiClipboard, BiHomeAlt, BiUSer, BiUser } from "react-icons/bi";
import { BsClipboardData, BsBriefcase, BsChatSquare } from "react-icons/bs";
//Link
import { Link } from "react-scroll";

const Nav = () => {
  return (
    <nav className="fixed bottom-2 ig:bottom-8 w-full overflow-hidden z-50">
      Nav
      <div className="container mx-auto">
        {/* nav inner*/}
        <div
          className="w-full bg-white/10 h-[96px] backdrop-blur-2xl 
          rounded-full max-w-[460px] mx-auto px-5 flex justify-between 
          text-2xl text-white/50"
        >
          <Link className="cursor-pointer">
            <BiHomeAlt />
          </Link>
          <Link>
            <BiUser />
          </Link>
          <Link>
            <BsClipboardData />
          </Link>
          <Link>
            <BsBriefcase />
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default Nav;
